import React from 'react';
import logo from './logo.svg';
import './App.css';
import AwesomeImage from './components/AwesomeImage';
import HoverOpacity from './components/HoverOpacity';

function App() {
  return (
    <div className="App">
      <HoverOpacity>
      <AwesomeImaga />
      </HoverOpacity>
    </div>
  );
}

export default App;
